import 'package:hlshop/all_file/all_file.dart';part 'rating_request_entity.freezed.dart';@freezedclass RatingRequestEntity with _$RatingRequestEntity {  const RatingRequestEntity._();  const factory RatingRequestEntity({    required String orderId,    required List<RatingOrderItem> ratingOrderItems,  }) = _RatingRequestEntity;}@freezedclass RatingOrderItem with _$RatingOrderItem {  const RatingOrderItem._();  const factory RatingOrderItem({    String? id,    String? comment,    DetailRating? detailRating,    List<String>? imageIds,  }) = _RatingOrderItem;}